					                {
					                    if (availqty1 > 1) { fromstock1 = true; }
					                    if (availqty1 == 0) { fromstock1 = false; }

					                    /* Manufactured Part Decision */
					                    if (partrecordtype1 == "M")
					                    {
					                        if (fromstock1 == true) { Inputs.chk_rework.Value = false; }
					                        if (fromstock1 == false) { Inputs.chk_rework.Value = false; }
					                        /* Determine Config Type */
					                        if (fromstock1 == true) { Inputs.var_configtype.Value = "M-STK"; }
					                        if (fromstock1 == false) { Inputs.var_configtype.Value = "MFG"; }
					                    }

					                    if (partrecordtype1 == "P")
					                    {
					                        if (fromstock1 == true) { Inputs.chk_rework.Value = false; }
					                        if (fromstock1 == false) { Inputs.chk_rework.Value = false; /* Rqd due to a bug in CTP which ignores the sales release if a purchased part record exists */; }
					                        /* Determine Config Type */
					                        Inputs.var_configtype.Value = "PUR";
					                    }
					                }
											}
                }

				}

				/* String to indicate on Last Page that the fg assy will come from a stocked part */

				if (Inputs.chk_rework.Value == false)
				{
            string assystring = "";
            if (Inputs.rad_supplytype.Value == "2") { assystring = Inputs.dec_soqty.Value.ToString() + " x " + Inputs.var_sku.Value + " will be taken from bool available_stock of " + availqty.ToString() + "."; }
            if (Inputs.rad_supplytype.Value == "1") { assystring = Inputs.dec_soqty.Value.ToString() + " x " + Inputs.var_sku.Value + " will be taken from bool available_stock of " + availqty1.ToString() + "."; }
            Inputs.var_fgvalidity.Value = assystring;

            /* Update BOM FG Part */
            Inputs.var_fgstockpart.Value = Inputs.var_sku.Value;

            /* Configure unwanted BOM parts */
            Inputs.var_ropepart.Value = "";
            Inputs.var_endpart.Value = "";
            Inputs.var_endscrewpart.Value = "";
            Inputs.var_wallplatepart.Value = "";
            Inputs.var_addassy1.Value = "";
            Inputs.var_addassy2.Value = "";
            Inputs.var_addassy3.Value = "";
            Inputs.var_addpart1.Value = "";
            Inputs.var_addpart2.Value = "";
            Inputs.var_addpart3.Value = "";
            Inputs.var_addpart4.Value = "";
            Inputs.var_ropecore.Value = "";
            Inputs.var_ropeouter.Value = "";
            Inputs.var_ropeqty.Value = 0;
            Inputs.var_endqty.Value = 0;
            Inputs.var_endscrewqty.Value = 0;
            Inputs.var_wallplateqty.Value = 0;
            Inputs.var_addassy1qty.Value = 0;
            Inputs.var_addassy2qty.Value = 0;
            Inputs.var_addassy3qty.Value = 0;
            Inputs.var_addpart1qty.Value = 0;
            Inputs.var_addpart2qty.Value = 0;
            Inputs.var_addpart3qty.Value = 0;
            Inputs.var_addpart4qty.Value = 0;
            Inputs.var_ropecoreqty.Value = 0;
