            Inputs.var_addassy1.Invisible= true;
            Inputs.var_addassy2.Invisible= true;
            Inputs.var_addassy3.Invisible= true;
            Inputs.var_addpart1.Invisible= true;
            Inputs.var_addpart2.Invisible= true;
