            Inputs.var_ropecore.Invisible= true;
            Inputs.var_ropeouter.Invisible= true;
            Inputs.var_ropeqty.Invisible= true;
            Inputs.var_endqty.Invisible= true;
            Inputs.var_endscrewqty.Invisible= true;
            Inputs.var_wallplateqty.Invisible= true;
            Inputs.var_addassy1qty.Invisible= true;
            Inputs.var_addassy2qty.Invisible= true;
            Inputs.var_addassy3qty.Invisible= true;
            Inputs.var_addpart1qty.Invisible= true;
            Inputs.var_addpart2qty.Invisible= true;
            Inputs.var_addpart3qty.Invisible= true;
            Inputs.var_addpart4qty.Invisible= true;
            Inputs.var_ropecoreqty.Invisible= true;
            Inputs.var_ropeouterqty.Invisible= true;

				}

        if (Inputs.chk_rework.Value == true)
        {
            Inputs.var_fgvalidity.Value = "Make Direct";
            Inputs.var_bomstatus.Value= "FALSE";
            Inputs.var_weightlookup.Value= "FALSE";
            Inputs.var_bomvalidity.Value= "FALSE";
            Inputs.var_bomvalidity.Value = "Make Direct";

            /* Update BOM FG Part */
            Inputs.var_fgstockpart.Value = "";

            if ((Inputs.var_bomstatus.Value == "** ERROR ** A component in the BOM has no Epicor Part Master Record.") && (Inputs.chk_erroron.Value == true))
            {
								MessageBox.Show("A Component in the BOM does not exist in the Parts Master table, or the record has been made inactive. Please contact the Operations department to resolve this issue.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);


            }
        }


        /* **************************************************************************************** */


        /* Calculates Net Weight */

        decimal CompWeight1 = 0m;
        decimal CompWeight2 = 0m;
        decimal CompWeight3 = 0m;
        decimal CompWeight4 = 0m;
        decimal CompWeight5 = 0m;
        decimal CompWeight6 = 0m;
        decimal CompWeight7 = 0m;
        decimal CompWeight8 = 0m;
        decimal CompWeight9 = 0m;
        decimal CompWeight10 = 0m;
        decimal CompWeight11 = 0m;
        decimal CompWeight12 = 0m;
        decimal CompWeight13 = 0m;

				decimal partWeight = 0.0m;

				/* CompWeight1 */
		    if (Inputs.var_ropepart.Value != "")
		    {
						available_part = UDMethods.PartExists(Context.CompanyID, Inputs.var_ropepart.Value);
		    }
		    if (available_part) {
		          UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_ropepart.Value, out partWeight);
		          CompWeight1 = partWeight * Inputs.var_ropeqty.Value;
		    }

